DROP TABLE if exists wetterapppk.city_weather;
DROP TABLE if exists wetterapppk.user_city;
DROP TABLE if exists wetterapppk.user;
DROP TABLE if exists wetterapppk.weather;
DROP TABLE if exists wetterapppk.city;
CREATE TABLE wetterapppk.city( city_id bigint(20) NOT NULL AUTO_INCREMENT,latitude double DEFAULT NULL,longitude double DEFAULT NULL, name varchar(255) NOT NULL, zip bigint(20) DEFAULT NULL, PRIMARY KEY (city_id),UNIQUE KEY (name, zip)) ENGINE = InnoDB;
CREATE TABLE wetterapppk.user(user_id bigint(20) NOT NULL AUTO_INCREMENT, password varchar(255) NOT NULL,temperature_unit varchar(255) NOT NULL,username varchar(200) NOT NULL, city_id bigint(20) DEFAULT NULL,PRIMARY KEY (user_id), UNIQUE KEY (username), FOREIGN KEY (city_id) REFERENCES wetterapppk.city (city_id)) ENGINE = InnoDB;
CREATE TABLE wetterapppk.weather(weather_id bigint(20) NOT NULL AUTO_INCREMENT,current_temp double DEFAULT NULL,date date NOT NULL, date_max_temp double DEFAULT NULL,date_min_temp double DEFAULT NULL,description varchar(255) DEFAULT NULL, humidity double DEFAULT NULL, icon varchar(255) DEFAULT NULL,last_updated datetime DEFAULT NULL,sunrise datetime DEFAULT NULL, sunset datetime DEFAULT NULL, wind_direction varchar(255) DEFAULT NULL, wind_speed double DEFAULT NULL,city_id bigint(20) DEFAULT NULL,PRIMARY KEY (weather_id), FOREIGN KEY (city_id) REFERENCES wetterapppk.city (city_id)) ENGINE = InnoDB;
CREATE TABLE wetterapppk.city_weather(city_id bigint(20) NOT NULL,weather_id bigint(20) NOT NULL,FOREIGN KEY (weather_id) REFERENCES wetterapppk.weather (weather_id), FOREIGN KEY (city_id) REFERENCES wetterapppk.city (city_id)) ENGINE = InnoDB;
CREATE TABLE wetterapppk.user_city(user_id bigint(20) NOT NULL, city_id bigint(20) NOT NULL,FOREIGN KEY (city_id) REFERENCES wetterapppk.city (city_id),FOREIGN KEY (user_id) REFERENCES wetterapppk.user (user_id)) ENGINE = InnoDB;
